      heightMeasureHandler.measureEvt.addEventListener(function (result) {
        var distance = result.distance > 1000 ? (result.distance / 1000).toFixed(2) + 'km' : result.distance + 'm';
        var vHeight = result.verticalHeight > 1000 ? (result.verticalHeight / 1000).toFixed(2) + 'km' : result.verticalHeight + 'm';
        var hDistance = result.horizontalDistance > 1000 ? (result.horizontalDistance / 1000).toFixed(2) + 'km' : result.horizontalDistance + 'm';
        heightMeasureHandler.disLabel.text = '空间距离:' + distance;
        heightMeasureHandler.vLabel.text = '垂直距离:' + vHeight;
        heightMeasureHandler.hLabel.text = '水平距离:' + hDistance;
      });
